import "./App.css";
import React, { useState, useEffect } from "react";

function App() {
  const url = "https://randomuser.me/api";
  const [data, setData] = useState(null);

  const fetchInfo = () => {
    return fetch(url)
      .then((res) => res.json())
      .then((d) => setData(d));
  };

  useEffect(() => {
    // fetchInfo();
    fetch("https://randomuser.me/api")
      .then((resp) => {
        return resp.json();
      })
      .then((res) => {
        console.log("res---", res);
        setData(res);
      });
  }, []);

  console.log("data--", data);

  return (
    <div className="App">
      <h1 style={{ color: "green" }}>using JavaScript inbuilt FETCH API</h1>
      <center>
        {data &&
          data.results.map((dataObj, index) => {
            return <div>{data.results.dob}</div>;
          })}
      </center>
    </div>
  );
}

export default App;
